import React from 'react';
import logo from './logo.svg';
import './App.css';




class App extends React.Component {

  render () {
    return (
      <div className="App">
        <header className="App-header">

          <p>
            Which one is the <b>fake</b> person?
          </p>


        </header>
      </div>
    );
  }

}

export default App;
